import React from 'react'
import { getCountries } from '../API'

const itemData = [
    {
        span: "Strain",
        p: "SARS-CoV-2"
    },
    {
        span: "Symptoms",
        p: "Fever, Cough, Fatigue"
    },
    {
        span: "Usual onset",
        p: "2–14 days "
    },


]


export default function Headtitle(countries) {
    return (
        <div>

            <div className="items">
                <div className="item">
                    {itemData.map((itemData, index) =>
                        <div key={index} className="item_list" >
                            <span>
                                {itemData.span}
                            </span>
                            <p>
                                {itemData.p}
                            </p>
                        </div>
                    )}

                </div>
            </div>
            <select >
                {countries.map(({ Country, ISO2 }) => (
                    <option key={ISO2} value={ISO2.toLowerCase()}>
                        {Country}
                    </option>
                ))}
            </select>
        </div>

    )
}
